"use strict";(self.webpackChunkhelp_pintar_co=self.webpackChunkhelp_pintar_co||[]).push([[1477],{30010:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"/cara-menulis-konten","metadata":{"permalink":"/blog/cara-menulis-konten","source":"@site/i18n/id/docusaurus-plugin-content-blog/cara-menulis-konten.md","title":"Cara Menulis Konten","description":"Ada 2 Navigasi pada Help Pintar.","date":"2024-12-10T04:57:28.854Z","formattedDate":"10 Desember 2024","tags":[{"label":"pembuatan-kontent","permalink":"/blog/tags/pembuatan-kontent"}],"readingTime":0.36,"hasTruncateMarker":false,"authors":[{"name":"Juni Yadi","title":"Lead DevOps Engineer","url":"https://github.com/juniyadi-pintar","imageURL":"https://avatars.githubusercontent.com/u/117881249?v=4","key":"juniyadi"}],"frontMatter":{"title":"Cara Menulis Konten","tags":["pembuatan-kontent"],"authors":"juniyadi"},"nextItem":{"title":"Bagaimana Cara Menambahkan Konten","permalink":"/blog/how-to-add-content"}},"content":"Ada 2 Navigasi pada Help Pintar.\\n\\nKetika membuat post, ikuti panduan berikut: \\n\\n1. H1 = Judul (Navigasi Kiri)\\n2. H2 = Judul (Navigasi Kanan)\\n3. H3 = Sub-Judul (Navigasi Kanan)\\n\\nJika anda menggunakan markdown, maka harus dibuat dengan # (Tanda Pagar)\\n\\n1. H1 = `#`\\n2. H2 = `##`\\n3. H3 = `###`\\n\\n\\n## Contoh H2\\n\\n### Contoh H3 (1)\\n\\n### Contoh H3 (1)\\n\\n### Contoh H3 (1)\\n\\n## Contoh H2 (1)"},{"id":"/how-to-add-content","metadata":{"permalink":"/blog/how-to-add-content","source":"@site/i18n/id/docusaurus-plugin-content-blog/how-to-add-content.md","title":"Bagaimana Cara Menambahkan Konten","description":"1. Buat Akun GitHub","date":"2023-10-04T10:33:59.000Z","formattedDate":"4 Oktober 2023","tags":[{"label":"internal","permalink":"/blog/tags/internal"}],"readingTime":0.88,"hasTruncateMarker":false,"authors":[{"name":"Juni Yadi","title":"Lead DevOps Engineer","url":"https://github.com/juniyadi-pintar","imageURL":"https://avatars.githubusercontent.com/u/117881249?v=4","key":"juniyadi"}],"frontMatter":{"title":"Bagaimana Cara Menambahkan Konten","date":"2023-10-04T10:33:59.000Z","tags":["internal"],"authors":"juniyadi"},"prevItem":{"title":"Cara Menulis Konten","permalink":"/blog/cara-menulis-konten"}},"content":"## 1. Buat Akun GitHub\\n\\n1. Alamat Tautan <https://github.com/signup>\\n2. Mendaftar dengan @pintar.co email dan buat username github dengan format **namakamu-pintar**\\n3. S\ufeffilahkan kirim pesan ke [devops@pintar.co](mailto:devops@pintar.co) kemudian lampirkan nama username github anda dan nama tim anda, anda akan di kirim link untuk bergabung ke organisasi <https://github.com/Pintar-Pemenang-Asia>\\n\\n## 2. Access Content Manager Documentation\\n\\nAfter you have access to our organization, you can edit content documentation from our admin panel.\\n\\n1. Content Manager URL: <https://help.stg.pintar.co.id/admin/>\\n2. Login with GitHub Account\\n3. Done, now you can add documentation based on the category\\n4. Detail Form\\n\\n   * Title = Title of The Documentation\\n   * Body\\n   * Sidebar Position = You can insert a number, and check the order in the preview website\\n   * Tags = You can add many tags in a single document, if you have multiple tags, separate them with comma, for example: **learner, instructor**\\n5. **Save using Publish => Publish Now**\\n\\n## 3. Preview Site\\n\\nYou can access it from this link <https://help.stg.pintar.co/>\\n\\nAfter we on production, the link and data will be moved to <https://help.pintar.co/>[](https://help.stg.pintar.co/)"}]}')}}]);